import React from "react";
import { useState } from "react";
import MenuIcon from '@mui/icons-material/Menu';
function Signup() {
    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
      };
    return (
      <div>
        <div className="home-container">
            <div className="menu">
                <button className="menu-btn" onClick={toggleMenu}>
                    <MenuIcon/>
                </button>
                {isMenuOpen && (
                    <div className="dropdown">
                    <button className="menu-item">Contact</button>
                    <button className="menu-item">About Us</button>
                    </div>
                )}
            </div>
            <div className="tit">
                <h2><img src="/images/f3.png" alt=""/>FOOD NETWORK</h2>
            </div>
            <div className="buttons-container">
                <button className="log-btn">Login</button>
                <button className="sig-btn">Sign up</button>
            </div>
        </div>
        <div className="top">
            <img src="/images/f1.png" alt=""/>
            <h1>Together, Let's Make a Difference</h1>
            <h2>Join us in leveraging technology for a more efficient, transparent, and compassionate approach to food redistribution on a global scale</h2>
        </div>
      </div>
    );
  }
  
  export default Signup;
